INSERT INTO `ospq_t_pages_description` (`fk_i_pages_id`, `fk_c_locale_code`, `s_title`, `s_text`) VALUES
(1, 'en_US', '{WEB_TITLE} - Someone has a question about your listing', '<p>Hi {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) left you a message about your listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(1, 'pl_PL', '{WEB_TITLE} - Ktoś ma pytanie dotyczące Twojego ogłoszenia', '<p>Witaj {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) zostawił Ci wiadomość z tym ogłoszeniem <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>:</p><p>{COMMENT}</p><p> Pozdrowienia,</p><p>{WEB_LINK}</p>'),
(1, 'ro_RO', '{WEB_TITLE} - Un utilizator a adăugat o întrebare despre anunțul tău', '<p>Bună {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) ți-a lăsat un mesaj despre anunțul tău <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>:</p><p>{COMMENT}</p><p>Echipa,</p><p>{WEB_LINK}</p>'),
(2, 'en_US', 'Please validate your {WEB_TITLE} account', '<p>Hi {USER_NAME},</p><p>Please validate your registration by clicking on the following link: {VALIDATION_LINK}</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(2, 'pl_PL', 'Prosimy o potwierdzenie Twojego {WEB_TITLE} konta', '<p>Witaj {USER_NAME},</p><p>Potwierdź swoją rejestrację klikając na poniższy link: {VALIDATION_LINK}</p><p>Dziękujemy!</p><p>Pozdrowienia,</p><p>{WEB_LINK}</p>'),
(2, 'ro_RO', 'Te rugăm să validezi contul pe {WEB_TITLE}', '<p>Bună {USER_NAME},</p><p>Te rugăm să confirmi înregistrarea dând click pe: {VALIDATION_LINK}</p><p>Mulțumim!</p><p>Echipa,</p><p>{WEB_LINK}</p>'),
(3, 'en_US', '{WEB_TITLE} - Registration successful!', '<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(3, 'pl_PL', '{WEB_TITLE} - Rejestracja przebiegła pomyślnie', '<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(3, 'ro_RO', '{WEB_TITLE} - Înregistrare cu succes!', '<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(4, 'en_US', 'Look at what I discovered on {WEB_TITLE}', '<p>Hi {FRIEND_NAME},</p><p>Your friend {USER_NAME} wants to share this listing with you <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Message:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_TITLE}</p>'),
(4, 'pl_PL', 'Sprawdź to {WEB_TITLE}! Może Cię zainteresuje', '<p>Witaj {FRIEND_NAME},</p><p>Twój znajomy {USER_NAME} przesyła Ci ogłoszenie, które może Cię zainteresować<a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Wiadomość:</p><p>{COMMENT}</p><p>Pozdrawiam,</p><p>{WEB_TITLE}</p>'),
(4, 'ro_RO', 'Uite ce am găsit pe {WEB_TITLE}', '<p>Bună {FRIEND_NAME},</p><p>Prietenul tău {USER_NAME} vrea să îți arate acest anunț <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Mesaj:</p><p>{COMMENT}</p><p>Echipa,</p><p>{WEB_TITLE}</p>'),
(5, 'en_US', '{WEB_TITLE} - New listings in the last hour', '<p>Hi {USER_NAME},</p><p>New listings have been published in the last hour. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(5, 'pl_PL', '{WEB_TITLE} - Nowe ogłoszenie in the last hour', '<p>Witaj {USER_NAME},</p><p>W ostatniej godzinie opublikowano nowe ogłoszenia. Sprawdź je!</p><p>{ADS}</p><p>-------------</p><p> Jeśli nie chcesz otrzymywać tych wiadomości, kliknij ten link:{UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(5, 'ro_RO', '{WEB_TITLE} - Anunț nou in the last hour', '<p>Bună {USER_NAME},</p><p>Au fost publicate anunțuri noi în ultima oră. Le poți vedea aici:</p><p>{ADS}</p><p>-------------</p><p>Pentru a te dezabona de la această alertă, click pe: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(6, 'en_US', '{WEB_TITLE} - New listings in the last day', '<p>Hi {USER_NAME},</p><p>New listings have been published in the last day. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(6, 'pl_PL', '{WEB_TITLE} - Nowe ogłoszenie in the last day', '<p>Witaj {USER_NAME},</p><p>W ostatnim dniu opublikowano nowe ogłoszenia. Sprawdź je!</p><p>{ADS}</p><p>-------------</p><p> Jeśli nie chcesz otrzymywać tych wiadomości, kliknij ten link:{UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(6, 'ro_RO', '{WEB_TITLE} - Anunț nou in the last day', '<p>Bună {USER_NAME},</p><p> Astăzi au fost publicate anunțuri noi. Le poți vedea aici:</p><p>{ADS}</p><p>-------------</p><p> Pentru a te dezabona de la această alertă, click pe: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(7, 'en_US', '{WEB_TITLE} - New listings in the last week', '<p>Hi {USER_NAME},</p><p>New listings have been published in the last week. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(7, 'pl_PL', '{WEB_TITLE} - Nowe ogłoszenie in the last week', '<p>Witaj {USER_NAME},</p><p>Nowe ogłoszenie opublikowane w ubiegłym tygodniu. Sprawdź je:</p><p>{ADS}</p><p>-------------</p><p> Jeśli nie chcesz otrzymywać tych wiadomości, kliknij ten link:: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(7, 'ro_RO', '{WEB_TITLE} - Anunț nou in the last week', '<p>Bună {USER_NAME},</p><p>Au fost publicate anunțuri noi în ultima săptămână. Le poți vedea aici :</p><p>{ADS}</p><p>-------------</p><p>Pentru a te dezabona de la această alertă, click pe: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(8, 'en_US', '{WEB_TITLE} - New listings', '<p>Hi {USER_NAME},</p><p>A new listing has been published, check it out!</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(8, 'pl_PL', '{WEB_TITLE} - Nowe ogłoszenie', '<p>Witaj {USER_NAME},</p><p>Opublikowane nowe ogłoszenie, sprawdź je! </p><p>{ADS}</p><p>-------------</p><p>Jeśli nie chcesz otrzymywać tych wiadomości, kliknij ten link: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(8, 'ro_RO', '{WEB_TITLE} - Anunț nou', '<p>Bună {USER_NAME},</p><p>A fost publicat un anunț nou!</p><p>{ADS}</p><p>-------------</p><p>Pentru a te dezabona de la această alertă, click pe: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(9, 'en_US', '{WEB_TITLE} - New comment', '<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),
(9, 'pl_PL', '{WEB_TITLE} - Nowy komentarz', '<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),
(9, 'ro_RO', '{WEB_TITLE} - Comentariu nou', '<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),
(10, 'en_US', '{WEB_TITLE} - Edit options for the listing {ITEM_TITLE}', '<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(10, 'pl_PL', '{WEB_TITLE} - Edytuj opcje ogłoszeń {ITEM_TITLE}', '<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(10, 'ro_RO', '{WEB_TITLE} - Opțiuni de editare pentru anunțul {ITEM_TITLE}', '<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(11, 'en_US', '{WEB_TITLE} - Validate your listing', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(11, 'pl_PL', '{WEB_TITLE} - Potwierdzenie ogłoszenia', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(11, 'ro_RO', '{WEB_TITLE} - Validează anunțul', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(12, 'en_US', '{WEB_TITLE} - A new listing has been published', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(12, 'pl_PL', '{WEB_TITLE} - Opublikowano nowe ogłoszenie ', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(12, 'ro_RO', '{WEB_TITLE} - A fost publicat un anunț nou', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(13, 'en_US', '{WEB_TITLE} - Recover your password', '<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(13, 'pl_PL', '{WEB_TITLE} - Odzyskiwanie hasła‏', '<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(13, 'ro_RO', '{WEB_TITLE} - Recuperare parolă', '<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(14, 'en_US', '{WEB_TITLE} - You requested an email change', '<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(14, 'pl_PL', '{WEB_TITLE} - Zmiana adresu e-mail', '<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(14, 'ro_RO', '{WEB_TITLE} - Ai solicitat modificarea adresei de e-mail', '<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(15, 'en_US', '{WEB_TITLE} - Please validate your alert', '<p>Hi {USER_NAME},</p><p>Please validate your alert registration by clicking on the following link: {VALIDATION_LINK}</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(15, 'pl_PL', '{WEB_TITLE} – Prosimy o potwierdzenie powiadomienia', '<p>Witaj {USER_NAME},</p><p>Kliknij na podany link, aby otrzymywać powiadomienia: {VALIDATION_LINK}</p><p>Dziękujemy!</p><p>Pozdrowienia,</p><p>{WEB_LINK}</p>'),
(15, 'ro_RO', '{WEB_TITLE} - Te rugăm să validezi alerta', '<p>Bună {USER_NAME},</p><p>Te rugăm să confirmi înregistrarea dând click pe următorul link: {VALIDATION_LINK}</p><p>Mulțumim!</p><p>Echipa,</p><p>{WEB_LINK}</p>'),
(16, 'en_US', '{WEB_TITLE} - Your comment has been approved', '<p>Hi {COMMENT_AUTHOR},</p><p>Your comment on <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> has been approved.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(16, 'pl_PL', '{WEB_TITLE} - Twój komentarz został zatwierdzony', '<p>Witaj {COMMENT_AUTHOR},</p><p>Twój komentarz dotyczący<a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>został zatwierdzony</p><p>Pozdrowienia,</p><p>{WEB_LINK}</p>'),
(16, 'ro_RO', '{WEB_TITLE} - Comentariul tău a fost aprobat', ' 	<p>Buna{COMMENT_AUTHOR},</p><p>Comentariul dvs.  <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> a fost aprobat.</p><p>Cu stima,</p><p>{WEB_LINK}</p> '),
(17, 'en_US', '{WEB_TITLE} - Validate your listing', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(17, 'pl_PL', '{WEB_TITLE} - Potwierdzenie ogłoszenia', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(17, 'ro_RO', '{WEB_TITLE} - Validează anunțul', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(18, 'en_US', '{WEB_TITLE} - A new user has registered', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(18, 'pl_PL', '{WEB_TITLE} – Zarejestrował się nowy użytkownik', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(18, 'ro_RO', '{WEB_TITLE} - S-a înregistrat un utilizator nou', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(19, 'en_US', '{WEB_TITLE} - Someone has a question for you', '<p>Hi {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) left you a message:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(19, 'pl_PL', '{WEB_TITLE} - Ktoś ma pytanie dotyczące Twojego ogłoszenia', '<p>Witaj {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) zostawił Ci wiadomość:</p><p>{COMMENT}</p><p>Pozdrowienia,</p><p>{WEB_LINK}</p>'),
(19, 'ro_RO', '{WEB_TITLE} - Un utilizator are o întrebare pentru tine', '<p>Bună {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) ți-a lăsat un mesaj:</p><p>{COMMENT}</p><p>Echipa,</p><p>{WEB_LINK}</p>'),
(20, 'en_US', '{WEB_TITLE} - Someone has commented on your listing', '<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),
(20, 'pl_PL', '{WEB_TITLE} – Ktoś skomentował Twoje ogłoszenie', '<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),
(20, 'ro_RO', '{WEB_TITLE} - Cineva a adăugat un comentariu la anunțul tău', '<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),
(21, 'en_US', '{WEB_TITLE} - Success creating admin account!', '<p>Hi {ADMIN_NAME},</p><p>The admin of {WEB_LINK} has created an account for you,</p><ul><li>Username: {USERNAME}</li><li>Password: {PASSWORD}</li></ul><p>You can access the admin panel here {WEB_ADMIN_LINK}.</p><p>Thank you!</p><p>Regards,</p>'),
(21, 'pl_PL', '{WEB_TITLE} - Nowy administrator został dodany poprawnie!', '<p>Witaj {ADMIN_NAME},</p><p>Administrator {WEB_LINK} stworzył dla Ciebie konto,</p><ul><li>Użytkownik: {USERNAME}</li><li>Hasło: {PASSWORD}</li></ul><p>Możesz zalogować się do panelu użytkownika tutaj {WEB_ADMIN_LINK}.</p><p>Dziękujemy!</p><p>Pozdrowienia,</p>'),
(21, 'ro_RO', '{WEB_TITLE} - Crearea contului de admin a fost cu succes!', '<p>Salutare {ADMIN_NAME},</p><p>Administratorul site-ului {WEB_LINK} a creat un cont pentru tine,</p><ul><li>Nume utilizator: {USERNAME}</li><li>Parolă: {PASSWORD}</li></ul><p>Poţi accesa panoul de administrare aici: {WEB_ADMIN_LINK}.</p><p>Îţi mulţumim!</p><p>Să auzim numai de bine,</p>'),
(22, 'en_US', '{WEB_TITLE} - Your ad is about to expire', '<p>Hi {USER_NAME},</p><p>Your listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> is about to expire at {WEB_LINK}.'),
(22, 'pl_PL', '{WEB_TITLE} - Twoje ogłoszenie niedługo wygaśnie ', '<p>Witaj {USER_NAME},</p><p>Twoje ogłoszenie <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>niedługo wygaśnie {WEB_LINK}.'),
(22, 'ro_RO', '{WEB_TITLE} - Anunţul tău va expira în curând', '<p>Salutare {USER_NAME},</p><p>Anunţul tău <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> de pe {WEB_LINK} va expira în curând.'),
(24, 'en_US', 'WalMart Kitty Shop Page', '<p style=\"background: LightSkyBlue;\"><a id=\"1297127630\" href=\"https://goto.walmart.com/c/2659082/1285217/9383?prodsku=1297127630&amp;u=https%3A%2F%2Fwww.walmart.com%2Fip%2FPet-cage-Hammock-pet-Cats-Hammock-Soft-Plush-pet-Bed-Suitable-Ferret-Cotton-Hammock-Guinea-Pig-Hamster-Gerbil-Kittens-Cats-cage-etc-1-2-Packs-2pack-b%2F1297127630&amp;intsrc=PUI2_9749\" target=\"_top\"><img src=\"https://i5.walmartimages.com/asr/a0a0462c-dec1-4382-a40d-6872e70d11f0.606a453c07d681a032f69f7808907fe8.jpeg?odnHeight=450&amp;odnWidth=450&amp;odnBg=ffffff\" alt=\"Kitty\" border=\"0\" /></a></p>\r\n<h6 style=\"background: LightSkyBlue;\"><br />SHOP WALMART FOR YOUR KITTY!!<br /><br /><br />$22.99USD</h6>'),
